import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import Home from "./pages/home/home";

import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
  <>
   <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}/>
      </Routes>
    </BrowserRouter>

  </>
  );
}

export default App;
